import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react';
import HomeComp from './component/homePage/homeComp';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route exact path = "/" element = { <HomeComp /> }></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
